import styles from './HomePage.module.css';

export const HomePage = () => {
    return (
        <section className={styles.home}>
            <div className={styles.welcomeBlock}>
              <h1 className={styles.title}>Добро пожаловать в AgriControl!</h1>
              <p className={styles.subtitle}>
                Ваш интеллектуальный помощник для управления сельскохозяйственными процессами.
              </p>
            </div>
            <div className={styles.infoBlock}>
              
              <p className={styles.infoText}>
                Начните с выбора интересующего раздела в меню сверху.
              </p>
            </div>
        </section>
    );
}
